import './App.scss';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          柿崎愛斗のポートフォリオサイト
        </p>

      </header>
    </div>
  );
}

export default App;
